import './style.css'

function Box(props){
    
    
    function pickMarble(){
        console.log(props.row + ' ' + props.col)
    }

    function releaseMarble(){
        console.log(props.row + ' ' + props.col)
    }

    return <div className='box' draggable onMouseDown={pickMarble} onMouseUp={releaseMarble} >{ props.currentVal }</div>
}

export default Box
